import React, { useState } from "react";

const App = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    age: "",
    eventType: "",
    date: "",
    description: "",
  });

  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    setFormData(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Here you can add your API call to backend
    console.log("Submitting form data:", formData);

    setSubmitted(true);
  };

  return (
    <div style={styles.container}>
      <div style={styles.formBox}>
        <h2 style={{ marginBottom: 20, color: "#fff" }}>Event Management Service</h2>

        {submitted ? (
          <div style={styles.thankYou}>
            <h3>Thank you for registering!</h3>
            <p>We will contact you soon.</p>
          </div>
        ) : (
          <form onSubmit={handleSubmit} style={styles.form}>
            <label style={styles.label}>
              Full Name
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
                style={styles.input}
                placeholder="Your full name"
              />
            </label>

            <label style={styles.label}>
              Email Address
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
                style={styles.input}
                placeholder="example@mail.com"
              />
            </label>

            <label style={styles.label}>
              Age
              <input
                type="number"
                name="age"
                min="1"
                max="120"
                value={formData.age}
                onChange={handleChange}
                required
                style={styles.input}
                placeholder="Your age"
              />
            </label>

            <label style={styles.label}>
              Event Type
              <select
                name="eventType"
                value={formData.eventType}
                onChange={handleChange}
                required
                style={styles.input}
              >
                <option value="">Select an event</option>
                <option value="wedding">Wedding</option>
                <option value="birthday">Birthday</option>
                <option value="conference">Conference</option>
                <option value="concert">Concert</option>
                <option value="other">Other</option>
              </select>
            </label>

            <label style={styles.label}>
              Event Date
              <input
                type="date"
                name="date"
                value={formData.date}
                onChange={handleChange}
                required
                style={styles.input}
              />
            </label>

            <label style={styles.label}>
              Additional Details
              <textarea
                name="description"
                value={formData.description}
                onChange={handleChange}
                placeholder="Write any special requirements or details"
                style={{ ...styles.input, height: 80 }}
              />
            </label>

            <button type="submit" style={styles.button}>
              Submit
            </button>
          </form>
        )}
      </div>
    </div>
  );
};

// Inline CSS styles
const styles = {
  container: {
    minHeight: "100vh",
    backgroundImage: "url('https://images.unsplash.com/photo-1504384308090-c894fdcc538d?auto=format&fit=crop&w=1470&q=80')",
    backgroundSize: "cover",
    backgroundPosition: "center",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    padding: 20,
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
  },
  formBox: {
    backgroundColor: "rgba(0,0,0,0.7)",
    padding: 30,
    borderRadius: 12,
    width: "100%",
    maxWidth: 450,
    color: "#fff",
    boxShadow: "0 8px 24px rgba(0,0,0,0.5)",
  },
  form: {
    display: "flex",
    flexDirection: "column",
  },
  label: {
    marginBottom: 15,
    fontSize: 16,
    fontWeight: "600",
  },
  input: {
    marginTop: 6,
    padding: "10px 12px",
    borderRadius: 6,
    border: "none",
    fontSize: 15,
  },
  button: {
    marginTop: 20,
    padding: "12px",
    fontSize: 18,
    borderRadius: 8,
    border: "none",
    backgroundColor: "#1DB954",
    color: "#fff",
    fontWeight: "700",
    cursor: "pointer",
    transition: "background-color 0.3s ease",
  },
  thankYou: {
    textAlign: "center",
  }
};

export default App;
